import ClothingImageCard from "./ClothingImageCard";
import React, { useState, useEffect } from "react";
import axios from "axios";

const ClothesList = ({ clothingtypeID, cardClick }) => {
  const [clothing, setClothes] = useState([]);

  useEffect(() => {
    const fetchClothes = async () => {
      const response = await axios.get("http://localhost:3001/clothes");
      setClothes(
        response.data.filter((item) => item.clothingtype === clothingtypeID)
      );
    };
    fetchClothes();
  }, [clothingtypeID]);

  return (
    <>
      {clothing.map((clothes) => (
        <div key={clothes.id} onClick={() => cardClick(clothes.id)}>
          <ClothingImageCard
            key={clothes.id}
            id={clothes.id} // required for DnD Kit
            clothingType={clothes.clothingtype}
            image={clothes.image}
            draggable={draggable} // ðŸ‘ˆ controlled by parent page
          />
        </div>
      ))}
    </>
  );
};

export default ClothesList;
